/** @format */

import "./Navbar.css";
import { NavLink } from "react-router-dom";
export const Navbar = () => {
  return (
    <div className='navbar-container'>
      <NavLink to='/create'>Create</NavLink>
      <NavLink to='/' >Logout</NavLink>
    </div>
  );
};
